import { Link } from 'react-router-dom';

const Card = (props) => {  
    return (
        <Link key={props.id} className="card" to={`logement/${props.id}`}>
            <img className="card__img" src={props.cover} alt={props.title}/>
            <p className="card__text">{props.title}</p>
        </Link>
    )


}

export default Card
